const Contact = () => {
  return (
    <div>
      <p>You may contact us directly through phone call or text message for a free quote, preferably during office hours however we do handle emergency situations 24 hours a day as well.</p>
      <a className='text-blue-500 ml-2 custom-footer-number bg-blue-900 p-24' href='tel:661-202-8255'>Call or text now! 661-202-8255</a>
      <p>Dont forget about our discounts we offer as shown below!</p>
    </div>
  );
};


export default Contact;
